/*Table structure for table `project_info` */

DROP TABLE IF EXISTS `project_info`;

CREATE TABLE `project_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `user_id` varchar(32) NOT NULL DEFAULT '' COMMENT '负责人id,逗号隔开',
  `project_name` varchar(32) NOT NULL DEFAULT '' COMMENT '项目名称',
  `project_desc` varchar(255) NOT NULL DEFAULT '' COMMENT '项目描述',
  `project_address` varchar(32) NOT NULL DEFAULT '' COMMENT '项目地址',
  `push_url` varchar(255) NOT NULL DEFAULT '' COMMENT '报警推送url',
  `state` tinyint(1) NOT NULL DEFAULT '0' COMMENT '状态【0：启用】【1：删除】【2：禁用】',
  `create_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '添加时间',
  `create_user` int(11) NOT NULL DEFAULT '0' COMMENT '添加人',
  PRIMARY KEY (`id`) USING BTREE
